import style from "./About.module.css"
const About = () => {
    return (
        <div className={style.ContainerAbout}>
            <p>| My name is Joseph and I am from Mar
                Silver Sea |</p>
            <hr></hr>
            <p>|    It is my first APP and I am very happy jijiji     |</p>
            <hr></hr>
            <p>|    My dream is: I don't know   |</p>
            <hr></hr>
        </div>
    )
};


export default About
